import React from "react";
import ReadBook from "./ReadBook";

const ReadList = ({ read, onDeleteRead }) => {
  return (
    <ul>
      {read.map((book) => (
        <ReadBook key={book.id} book={book} onDeleteRead={onDeleteRead} />
      ))}
    </ul>
  );
};

export default ReadList;
